export default {
    data() {
      return {
        obra: {
          titulo: '',
          tipo: '',
          data_apresentacao: '',
          resumo: '',
          palavras_chave: ''
        },
        autor: {
          matricula_autor: '',
          nome_autor: '',
          email_autor: ''
        },
        orientador: {
          matricula_orientador: '',
          nome_orientador: '',
          titulo_academico: '',
          area_atuacao: '',
          email_orientador: ''
        },
        coorientador: {
          matricula_coorientador: '',
          nome_coorientador: '',
          titulo_academico: '',
          area_atuacao: '',
          email_coorientador: ''
        },
        curso: {
          nome_curso: ''
        }
      };
    },
    methods: {
      submitForm() {
        console.log('Formulário enviado:', this.obra, this.autor, this.orientador, this.coorientador, this.curso);
      },
      onFileChange(event) {
        const file = event.target.files[0];
        if (file) {
          console.log('Arquivo selecionado:', file.name);
        }
      }
    }
  };
